import logo from './logo.svg';
import './App.css';
import { useState } from "react";

function App() {
  const [text, setText] = useState("I'm bored");
  const buttonStuff = () => {
    if (text == "I'm bored") {
      setText("DRINK");
    } else {
      setText("I'm bored");
    }
  }
  return (
    <div className="App">
      <header className="App-header">
        <button onClick={buttonStuff}>
          {text}
        </button>


        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
